import React from "react";
import { useHistory } from "react-router-dom";
import { InputGroup } from "@blueprintjs/core";
const LeftSideContactUs = ({ setType }) => {
  const history = useHistory();
  return (
    <div>
      <div style={{ marginTop: "35%" }}>
        <label
          style={{
            color: "#3C3C3C",
            fontSize: "25px",
            fontWeight: "700",
          }}
        >
          Contact Us
        </label>
      </div>

      <div style={{ marginTop: "23px" }}>
        <InputGroup
          className="inp"
          leftIcon="person"
          type="text"
          placeholder="Email"
          style={{
            backgroundColor: "#F0EAE4",
            borderRadius: "10px",
            border: "0px",
            width: "85%",
            height: "40px",
          }}
        ></InputGroup>
      </div>

      <div style={{ marginTop: "23px" }}>
        <InputGroup
          className="inp"
          leftIcon="office"
          type="text"
          placeholder="Name"
          style={{
            backgroundColor: "#F0EAE4",
            borderRadius: "10px",
            border: "0px",
            width: "85%",
            height: "40px",
          }}
        ></InputGroup>
      </div>

      <div style={{ marginTop: "23px" }}>
        <InputGroup
          className="inp"
          leftIcon="mugshot"
          type="text"
          placeholder="Name"
          style={{
            backgroundColor: "#F0EAE4",
            borderRadius: "10px",
            border: "0px",
            width: "85%",
            height: "40px",
          }}
        ></InputGroup>
      </div>

      <div style={{ marginTop: "23px" }}>
        <InputGroup
          className="inp"
          leftIcon="phone"
          type="text"
          placeholder="Contact #"
          style={{
            backgroundColor: "#F0EAE4",
            borderRadius: "10px",
            border: "0px",
            width: "85%",
            height: "40px",
          }}
        ></InputGroup>
      </div>
      <div>
        <label>Farm Type</label>
      </div>
    </div>
  );
};

export default LeftSideContactUs;
